import React from "react";
import { Fragment } from "react";
import CardList from './CardList';
import { robots } from './robots';
import Searchbox from './Searchbox';

const App = () =>
{
  return(
    <Fragment>
    <h1>RoboFriends</h1>
    <Searchbox/>
    <CardList robots={robots}/>
    </Fragment>
  );
}
export default App;
